import React from "react";
import styled from "styled-components"

const Main= (props) => {
    return (
        <DateHeader>
            <Sun>일</Sun>
            <Week>월</Week>
            <Week>화</Week>
            <Week>수</Week>
            <Week>목</Week>
            <Week>금</Week>
            <Sat>토</Sat>


        </DateHeader>
    )
}

export default Main;


const DateHeader = styled.div `
display: flex;
flex-direction: column
    background-color: white;
`;

const Sun = styled.div`
background-color: white;
    color: tomato;
`;

const Week = styled.div `
background-color: white;
    color: black;
`;

const Sat = styled.div `
background-color: white;
    color: blue;
`;
